import { Injectable } from '@angular/core';
import { Book } from '../book.model';

@Injectable({
  providedIn: 'root'
})
export class HomeService {

  constructor(public http:HttpClient) { }
  book =new Book();
  baseServerUrl="http://localhost:8081/digitalbooks/search?hulk 6&Karthik&401e&Comic&Marvel";

  rearchBook(){
    console.log("Start calling api")
    return this.http.get<Book>(this.baseServerUrl)
  }
}
